	(1, 0, 0, 2, '', '产品发布', '【小程序】支持快速购买啦！', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/T3Rgx0b809tW192MAUa332BV6BM159.png', '亲爱的各位老板们，你们期待了一周的人人商城更新时间又到了，本周我们主要的更新内容是，小程序支持快速购买！\r\n小程序快速购买完美保留了主商城中快速购买的所有功能，让您在小程序中也能轻松创建！', '&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/q1m8y9Wr0S1aaSL0s8g9WFEezKY0Ae.png&quot;width=&quot;100%&quot;alt=&quot;3.png&quot;/&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/KZHZ5mtd4VGhV7DTj5TodiNF7zSf4K.png&quot;width=&quot;100%&quot;alt=&quot;5.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;为了让小程序与主商城的快速购买功能完美结合，我们对后台页面做了优化调整，增加了小程序和公众号页面类型，更明确便于您选择设置。&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;color:=&quot;&quot;&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/ww5CD62c2S2SyscLy77S072HVC6wC0.gif&quot;width=&quot;100%&quot;alt=&quot;8.gif&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;在小程序店铺装修中，我们也相应地增加了快速购买链接，您可以将快速购买链接添加到小程序中。&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;color:=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/NhIhih0SHcPHi55HrFi5iixiDi50f4.gif&quot;width=&quot;100%&quot;alt=&quot;9.gif&quot;/&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;color:=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/ZA5Y3y10zzcBjrJ0rjRQw1JyrsW3QR.png&quot;width=&quot;100%&quot;alt=&quot;6.png&quot;/&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;我们以用户中心为例，在小程序用户中心中添加快速购买入口链接，您点击该入口即可进入到快速购买页面，方便快捷。&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;color:=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/I9ttionoTX48uPXITau700tnn866OU.gif&quot;width=&quot;100%&quot;alt=&quot;7.gif&quot;/&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;color:=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word;font-family: &quot;sans=&quot;&quot;font-size:=&quot;&quot;white-space:=&quot;&quot;color:=&quot;&quot;span=&quot;&quot;p=&quot;&quot;&gt;&lt;span style=&quot;color: rgb(136, 136, 136);font-size: 15px;&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;已购买【快速购买】插件的用户，更新系统并重新上传小程序代码，即可享受小程序快速购买哦~&lt;/p&gt;&lt;p&gt;VIP尊享版用户可免费使用价值999元的【快速购买】插件~&lt;/p&gt;', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/250.html', 1, 1527240198, 1527247885),
	(2, 0, 0, 1, '', '最新动态', '【周期购插件】上线，4月11日-13日限时优惠，仅售1299元！', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/k1Z0stPIO9L5p7XhPzH9SS3JXqH7iZ.png', '【周期购插件】上线，4月11日-13日限时优惠，仅售1299元！', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/227.html', 5, 1527241099, 1527241923),
	(3, 0, 0, 2, '', '产品发布', '【多商户】支持积分商城提现，积分也可兑换现金！', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/XLOOTisUeu3vgZpMMmMVpwfMRXV3k3.png', '人人商城多商户支持积分商城提现了，多商户积分商城兑换积分也可根据比例转换为现金进行提现，有利于提升商户的积极性。\r\n人人商城分销支持分销佣金显示，分销商在浏览商品的时候即可清晰的看到自己可获得的佣金，有利于促进分销商的购买积极性。', '&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/hKFrRK2rw3XV4kVfoxfJvzvroxXDJ4.png&quot;width=&quot;100%&quot;alt=&quot;内页卡片.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;盼星星盼月亮，终于到周二更新日，二毛如约而至！今天给大家带来2条充分提升商户积极性、分销商积极性的好消息！&lt;/p&gt;&lt;p&gt;人人商城多商户支持积分商城提现了，多商户积分商城兑换积分也可根据比例转换为现金进行提现，有利于提升商户的积极性。&lt;/p&gt;&lt;p&gt;人人商城分销支持分销佣金显示，分销商在浏览商品的时候即可清晰的看到自己可获得的佣金，有利于促进分销商的购买积极性。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/Fa9NeDP8B3PNALD5n89A1EAd1lI93D.png&quot;width=&quot;100%&quot;alt=&quot;标题文字-1.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/VhHhvH17BH2KVbv2K3kU1O9BMzLUMU.png&quot;width=&quot;100%&quot;alt=&quot;未标题-1.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;多商户后台增加商城积分订单提现功能，会员兑换的积分，可按一定的比例进行现金兑换，可有效调动商户的积极性，活跃商城。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/naQ480284c7z2lz59Q2125Hzwhg4t9.png&quot;width=&quot;100%&quot;alt=&quot;未标题-2.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(89, 89, 89);font-family: 微软雅黑;font-size: 15px;background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;您可在后台清晰的看到订单可提现金额和订单实际消费的金额，便于您进行订单提现管理。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/flzP1iEN3r5iC4Loi4v44Zve51RqZV.png&quot;width=&quot;100%&quot;alt=&quot;标题文字-2.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/tzTDVZpGfvBL24f45TDLKTRiGiB4gb.png&quot;width=&quot;100%&quot;alt=&quot;商品详情-分销佣金-1.png&quot;/&gt;&lt;/p&gt;&lt;p&gt;分销商品在前台增加佣金按钮显示，通过明确的佣金信息展示，可吸引分销商下单消费，提升商品成交率。&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/g0yvi5tTX0kvgOTiYy5ktIkTTxvodK.gif&quot;width=&quot;100%&quot;alt=&quot;商品列表-分销佣金-1.gif&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(89, 89, 89);font-family: 微软雅黑;font-size: 15px;background-color: rgb(255, 255, 255);&quot;&gt;分销商在浏览商品时能看到每件商品下单后可获得的佣金情况，有利于吸引分销商下单消费。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/257.html', 2, 1527240584, 1527240693),
	(4, 0, 0, 2, '', '产品发布', '【小程序】支持整点秒杀，与商城秒杀100%兼容，全新UI样式为用户带来更好地使用体验', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/bC97qQOh99a6c5aQ17Vv9A569QcHfC.png', '【小程序】支持整点秒杀，与商城秒杀100%兼容，全新UI样式为用户带来更好地使用体验。', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/265.html', 3, 1527240656, 1527241932),
	(5, 0, 0, 1, '', '最新动态', '易联互动团队春季团建活动', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/y9tkILU2255aldIRRDY51kiAYLtll5.png', '春暖花开，正是踏春的好时节，易联互动团队在3月的最后一天进行了春季团建活动，小伙伴们在活动中走进大自然，舒展筋骨，感受春季万物复苏的气息，有利于我们锻炼身体，让我们有更充沛的精力投入到工作中，更好的为每一位客户服务！\r\n周六早起出发，天气微凉这让大部分小伙伴们感受到了丝丝寒意，但这并没有阻挡大家团建的热情。我们先来到草莓采摘大棚，开始了摘摘摘、吃吃吃的草莓采摘之旅，小伙伴们各个收获满满，摘得不亦乐乎！', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/224.html', 4, 1527241192, 1527247091),
	(6, 0, 0, 1, '', '最新动态', '【人人商城】劳动节放假公告', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/zSgRHQHk5HRyK3XhRkHGj5xjjhRjOj.jpg', '【人人商城】劳动节放假公告', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/240.html', 6, 1527241719, 1527241916),
	(7, 0, 0, 3, '', '更新日志', '2018年05月18日更新日志', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/DEf1e3qz92529C1q8GG1tkgP13ZCz3.png', '20180518174728\r\n\r\n优化 手机端核销统计订单详情显示问题\r\n优化 部分用户小程序端多规格商品加购物车的问题\r\n优化 自动收货优惠券赠送的问题\r\n修复 商城权限的问题\r\n修改 商品详情页选择规格，点击选择之后，要是下单还要在重新在选择一下的问题\r\n修复 商城订单导出时，订单号显示为昵称的问题\r\n修复分销佣金任务，提交订单不付款，佣金任务也会产生进度的问题\r\n修复 添加虚拟评论，时间都是0或5的整数时间的问题\r\n修复 卖家通知不通知的问题\r\n修复 商城门店-核销记录按照核销门店搜索搜索为空的问题\r\n修复 选项卡分类信息显示不完全的问题\r\n修复 刮刮卡如果先点击奖励说明，然后退出来就无法刮涂层的问题', '', 0, 1, 1, 'http://www.we7shop.com/newsDetail/nid/261.html', 7, 1527241817, 1527246483),
	(8, 0, 0, 3, '', '更新日志', '2018年05月21日更新日志', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/DEf1e3qz92529C1q8GG1tkgP13ZCz3.png', '20180521172300\r\n\r\n优化 电子面单打印邮政系快递时提示缺少邮编的问题\r\n修复 小程序全返活动自定义文字不显示的问题\r\n修复 反馈商品编辑里面设置的会员折扣，不生效的问题(增加不能设置为0的提示)\r\n修复 余额提现可以设置满多少元才允许提现，但是手机端提现页面没有提示的问题\r\n修复 手机端商家管理中心维权打款提示签名错误\r\n修复 店铺装修分销中心模板未同步最新样式\r\n修复 部分用户超级海报的关注海报关键字不触发的问题\r\n修复 砍价页面对IOS设备兼容性差而导致的页面白屏问题\r\n修复 多商户店铺装修富文本中上传图片时可以看到全部图片,商户追加资料使用自定义表单图片也可以看到全部图片的问题\r\n修复 任务中心奖励记录，发放时间错误问题\r\n修复 代付订单异常关闭的问题。  现在关闭用户订单时同时将关闭微信支付订单\r\n修复 商城消息队列的问题\r\n修改 系统管理--数据--工具--七牛云存储 不生效的问题\r\n修复 商城会员添加了标签组，但是会员列表只显示等级不显示标签组的问题\r\n修复 积分商城商品限制了每人兑换次数，但是在创建订单页面没有限制的问题', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/262.html', 8, 1527241896, 1527246472),
	(9, 0, 0, 3, '', '更新日志', '2018年05月22日更新日志', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/DEf1e3qz92529C1q8GG1tkgP13ZCz3.png', '20180522092052\r\n\r\n公告一：为规范小程序发布流程，人人商城将于2018年6月15日关闭旧版小程序发布流程，望各位用户悉知！公告二：因七牛存储与微擎功能重复，我们将于6月15日关闭人人商城七牛存储功能，已经开启的用户不会影响，未开启的用户，此后将不会再显示该功能，望各位用户悉知！因以上功能变更给您造成的不便我们深表抱歉，敬请谅解，感谢您对人人商城的支持！\r\n\r\n新增 商城秒杀样式，提供2套样式供您选择\r\n新增 商城秒杀风格色时，提供5种颜色供您选择，更改后，可同步更改秒杀订单详情页颜色\r\n新增 小程序秒杀功能，功能同公众号商城一致，全新样式，带给您不一样的体验~\r\n优化 秒杀部分逻辑', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/263.html', 9, 1527241984, 1527246446),
	(10, 0, 0, 3, '', '更新日志', '2018年05月23日更新日志', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/DEf1e3qz92529C1q8GG1tkgP13ZCz3.png', '20180523174229\r\n\r\n修复 快速购买页面不修改商城购物车数量角标数字的问题\r\n修复 公众号端底部菜单显示移位的问题\r\n修复 商城优惠券已经不能添加优惠券图片，但是还显示的问题\r\n修复 小程序付款时选择了自提但是还显示货到付款的问题\r\n修复 商家佣金提现通知无法开启\r\n修复 门店目录问题\r\n修复 全返文字 的问题', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/267.html', 10, 1527246744, 1527246744),
	(11, 0, 0, 1, '', '最新动态', '【记次时商品】功能更新，让您花式玩转记次时商品轻松核销！', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/bXIjjWBw99f2FyB6FQuVi9NbyuwWj9.png', '记次时商品是一种新型的消费方式，它能将线上和线下消费场景紧密的联系在一起，轻松为线下门店引流。\r\n本次记次时商品更新，让您花式玩转记次时商品轻松核销，单卡、多卡商品模式并存，核销记录便捷查看一目了然，店员绑定所属门店即可进行核销，避免核销信息混乱。', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/239.html', 11, 1527247605, 1527247605),
	(12, 0, 0, 2, '', '产品发布', '久等了，小程序砍价真的来了！', 'http://foxteamdemo.oss-cn-qingdao.aliyuncs.com/images/3997/2018/05/PP4nqed7ACEPl7c700cd46e6AN2L6N.png', '3月初，二毛透露了小程序接下来的开发规划后，很多老板在后台留言，墙裂希望人人商城的小程序能尽快支持砍价功能！让您久等了，小程序砍价来了！\r\n\r\n1.小程序砍价与主商城砍价功能完美兼容。\r\n2.通过小程序最热风口以及砍价活动所具备的超强营销传播能力，带动商城提升商品销量。\r\n3.全面优化小程序砍价页面，布局更合理，用户的使用体验更好。\r\n4.小程序砍价功能无需关注，分享给好友即可助力好友砍价。', '', 0, 1, 1, 'https://www.we7shop.com/newsdetail/nid/232.html', 12, 1527248168, 1527248168);
